function Payment(){
    return (
        <div className='payment'>
            <h4>Payment methods</h4>
            <div className='row'>
            <Paypal style={{width: 100 }} />
            <Visa style={{width: 100 }} />
            <Mastercard style={{width: 100 }} />
            </div>
            <div className='row'>
            <Maestro style={{width: 100 }} />
            <Discover style={{width: 100 }} />
            
            </div>
        </div>
    );
}

export default Payment;
